import React, { useState } from 'react';

export const SelectMenu = (props) => {
   // const [value, setValue] = useState(props.defaultValue);

    const onChange = e => {
        console.log('selected', e.target.value);
      };

    return (
        <Select defaultValue={props.defaultVal} style={{width: 120}} onChange={onChange}>
            {props.options.map(({label, value}) => <Option value={value} key={value + '_' + label}>{label}</Option>)}
      </Select>
    );

}
